import React, {Component, useEffect, useState} from "react";
import axios from 'axios';
import MenuBar from "../components/MenuBar";

function Test2() {
    const [addr, setAddr] = useState();
    const [jsondata, setJsondata] = useState([]);

    useEffect( () => {
        axios( {
            method: 'get',
            url: '/text',
        })
        .then(response => {
            var results = JSON.stringify(response.data);
            console.log("이건 새로 변수에 담은거: " + results);
            setAddr(response.data[0]);
        })
    }, []);

    return (
        <div>
            {addr}
            <form action="" method="GET">
                    <div>
                        <select name="symptom_level">
                            <option>증상 정도</option>
                            <option value="1">매우 아픔</option>
                            <option value="2">조금 아픔</option>
                            <option value="3">보통</option>
                            <option value="4">약한 증상</option>
                            <option value="5">의심 증상</option>
                        </select>
                        <select name="symptom">
                            <option>증상 선택</option>
                            <option>머리 아픔</option>
                            <option>눈 이상</option>
                            <option>뼈 부러짐</option>
                            <option>코 막힘</option>
                            <option>이 아픔</option>
                        </select>
                    </div>
                    <div>
                        <button type="submit">검색</button>
                    </div>
                </form>
        </div>
    )
}

export default Test2;
